import m from 'mithril'
import {
  Button,
  Icon,
  Icons,
  Input,
  Menu,
  MenuItem,
  Drawer,
  Tag,
  SelectList,
  ListItem,
  Toaster
} from 'construct-ui'

import {Nav, showToast} from './Nav'

const mockSearches = [
  {
    date: "23/12/20",
    season: "202",
    line: "2",
    model: "m2200100",
    color: "cw425",
    size: "50",
    user: "ntaov",
    cliente: "Kristina",
    feedback: "",
    ordine: ""
  },
  {
    date: "23/12/20",
    season: "202",
    line: "2",
    model: "m2300100",
    color: "cg217",
    size: "50",
    user: "mpetrosi",
    cliente: "natalia",
    feedback: "ok da Parigi, rientra il 10/01",
    ordine: "#24551 r15"
  },
  {
    date: "23/12/20",
    season: "202",
    line: "2",
    model: "m2200100",
    color: "cw425",
    size: "50",
    user: "ntaov",
    cliente: "Kristina",
    feedback: "",
    ordine: ""
  },
  {
    date: "23/12/20",
    season: "202",
    line: "2",
    model: "m2300100",
    color: "cg217",
    size: "50",
    user: "mpetrosi",
    cliente: "natalia",
    feedback: "ok da Parigi, rientra il 10/01",
    ordine: "#24551 r15"
  },
  {
    date: "23/12/20",
    season: "202",
    line: "2",
    model: "m2200100",
    color: "cw425",
    size: "50",
    user: "ntaov",
    cliente: "Kristina",
    feedback: "",
    ordine: ""
  },
  {
    date: "23/12/20",
    season: "202",
    line: "2",
    model: "m2300100",
    color: "cg217",
    size: "50",
    user: "mpetrosi",
    cliente: "natalia",
    feedback: "ok da Parigi, rientra il 10/01",
    ordine: "#24551 r15"
  },
  {
    date: "23/12/20",
    season: "202",
    line: "2",
    model: "m2200100",
    color: "cw425",
    size: "50",
    user: "ntaov",
    cliente: "Kristina",
    feedback: "",
    ordine: ""
  },
  {
    date: "23/12/20",
    season: "202",
    line: "2",
    model: "m2300100",
    color: "cg217",
    size: "50",
    user: "mpetrosi",
    cliente: "natalia",
    feedback: "ok da Parigi, rientra il 10/01",
    ordine: "#24551 r15"
  }
]

const headers = [
  "date",
  "season",
  "line",
  "model",
  "color",
  "size",
  "user",
  "cliente",
  "feedback",
  "ordine"
];

let filter = {
  model: 'M2',
  color: 'C',
}


Object.filter = (obj, filter) => {
  let key, results = []
  let queries = Object.keys(filter)

  for (key in obj) {
    if (obj.hasOwnProperty(key)) {
      const search = obj[key]
      for (let i = 0; i < queries.length; i++) {
        let q = queries[i]
        if (!search[q].includes(filter[q])) {
          i++
        }
        if (i === queries.length - 1) {
          results.push(search)
        }
      }
    }
  }
  return results
}

let filteredSearches = Object.filter(mockSearches, filter)

let dates = [], seasons = [], modelsSet = new Set(), colors = [], sizes = [], users = [], clients = [], feedbacks = [], orders = []

filteredSearches.forEach((item, i) => {

  modelsSet.add(item.model)
});

let modelsArr = [...modelsSet]

console.log(modelsArr);


let Headers = {
  view(vnode) {
    return m(
      ".input-wrapper.flex",
      headers.map((header) => {
        return m(SelectList, {
          items: modelsArr,
          itemRender: (item) =>
            m(ListItem, {
              label: item,
              contentRight: m("", {
                style: {
                  height: "10px",
                  width: "10px",
                  borderRadius: "50px",
                  background: item
                }
              })
            }),
          itemPredicate: (query, item) =>
            item.toLowerCase().includes(query.toLowerCase()),
          trigger: m(Button, {
            // iconLeft: Icons.DROPLET,
            basic: true,
            label: 5,
            // iconRight: Icons.CHEVRON_DOWN
          })
        })
      })
    );
  }
};

let Search = {
  oninit(vnode){
    vnode.state.changed = false;
    vnode.tag.search = vnode.attrs.search
    vnode.state.search = vnode.attrs.search
  },
  view(vnode) {
    let {
      date,
      season,
      line,
      model,
      color,
      size,
      user,
      cliente,
      feedback,
      ordine
    } = vnode.state.search;

    return m(".search.flex.text-center", [
      m(Input, {
        value: vnode.state.search.date,
        oninput: (e) => {
          console.log(date, vnode.tag.search.date);
          vnode.state.search.date = e.srcElement.value
          while (vnode.state.search.date != vnode.tag.search.date) {
            vnode.state.changed = true;
            e.srcElement.style.background = '#ffffb0'
          }

        }
      }),
      m(Input, {
        value: season
      }),
      m(Input, {
        value: line
      }),
      m(Input, {
        value: model
      }),
      m(Input, {
        value: color
      }),
      m(Input, {
        value: size
      }),
      m(Input, {
        value: user
      }),
      m(Input, {
        value: cliente
      }),
      m(Input, {
        style: 'width: 250px;',
        value: feedback
      }),
      m(Input, {
        value: ordine
      })
    ]);
  }
};

let Richieste = {
  view(vnode) {
    return [
    m(Nav),
    m(".searches-wrapper", [
      m("h1", "Richieste Solomeo"),
      m(Headers),
      m(
        ".searches-list",
        filteredSearches.map((item) => {
          return m(Search, { search: item });
        })
      )
    ])
  ]}
};

exports.Richieste = Richieste
